      | 36502 -> { ItemTypeData.id= 36502; name= "Women's 'Hephaestus' Pants (cyan)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   These functional but high tech pants retain the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each pair of pants are crafted from cyan-shaded poly fabrics that are extremely durable yet comfortable enough to wear for extended periods. Additional pockets, straps and utility belts allow for a wide range of tools to be carried with the wearer while performing their duties.  "; marketGroupId= Some(1403); groupId= 1090; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
